  [],\n\t\"title\": \"Attributes for MRB_E2RF1 Catchments by Major River Basins in
  the Conterminous United States: Average Daily Minimum Temperature, 2002\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 11,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2013-03-15T21:07:36.998669\",\n\t\"name\": \"attributes-for-mrb-e2rf1-catchments-by-major-river-basins-in-the-conterminous-united-state-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This tabular data set represents the average
  daily minimum temperature in Celsius multiplied by 100 for 2002, compiled for every
  MRB_E2RF1 catchment of selected Major River Basins (MRBs, Crawford and others, 2006).
  The source data were the Near-Real-Time High-Resolution Monthly Average Maximum/Minimum
  Temperature for the Conterminous United States for 2002 raster data set produced
  by the Spatial Climate Analysis Service at Oregon State University. The MRB_E2RF1
  catchments are based on a modified version of the Environmental Protection Agency's
  (USEPA) ERF1_2 and include enhancements to support national and regional-scale surface-water
  quality modeling (Nolan and others, 2002; Brakebill and others, 2011). Data were
  compiled for every MRB_E2RF1 catchment for the conterminous United States covering
  New England and Mid-Atlantic (MRB1), South Atlantic-Gulf and Tennessee (MRB2), the
  Great Lakes, Ohio, Upper Mississippi, and Souris-Red-Rainy (MRB3), the Missouri
  (MRB4), the Lower Mississippi, Arkansas-White-Red, and Texas-Gulf (MRB5), the Rio
  Grande, Colorado, and the Great basin (MRB6), the Pacific Northwest (MRB7) river
  basins, and California (MRB8).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
